            string last_tk = text;
            string last_last_tk = "";

            for (int i = 1; i < words; i++)
            {
                int count = 0;
                for (int j = 0; j < __k_.Count; j++) {
                    if (__k_[j].Contains(last_last_tk+"_"+last_tk+"_")) {
                        count += __f_[j];
                    }
                }

                if (count == 0) {
                    last_tk = "";
                    last_last_tk = "";
                    for (int j = 0; j < __k_.Count; j++) {
                        if (__k_[j].Contains("__")) {
                            count += __f_[j];
                        }
                    }
                }

                int t = r.Next(count);
                for (int j = 0; j < __k_.Count; j++) {
                    if (__k_[j].Contains(last_last_tk+"_"+last_tk+"_")) {
                        t -= __f_[j];
                        if (t < 0) {
                            last_last_tk = last_tk;
                            last_tk = x.Replace(__k_[j], "");
                            text += " "+last_tk;
                            break;
                        }
                    }
                }
            }

            return text;
        }

